import axios from 'axios'
import React, { useState } from 'react'
const SignOnJ = () => {

const [myuser, setmyuser]=useState([])
  const add=()=>{
    let y=myuser
    axios.put('http://localhost:1234/Users/addUser',myuser).then(l=>{setmyuser(l.data)},alert("Added successfully"))
  }

  return (
    <div>
    <input type='text' placeholder='Enter name' onChange={(e)=>setmyuser({name:e.target.value})}></input>
    <input type='text' placeholder='Enter description' onChange={(e)=>setmyuser({id:e.target.value})}></input>
    <input type='text' placeholder='Enter pic' onChange={(e)=>setmyuser({pic:e.target.value})}></input>
    <input type='text' placeholder='Enter level' onChange={(e)=>setmyuser({level:e.target.value})}></input>
    <input type='text' placeholder='Enter duration' onChange={(e)=>setmyuser({duration:e.target.value})}></input>
    <input type='text' placeholder='Enter type' onChange={(e)=>setmyuser({type:e.target.value})}></input>
    <input type='button' value='Save' onClick={()=>add()}></input>
  </div>
  )
}

export default SignOnJ
